[{"location":"api/#API-Reference","page":"API Reference","title":"API Reference","text":"","category":"section"},{"location":"api/","page":"API Reference","title":"API Reference","text":"Modules = [sciml]","category":"page"},{"location":"api/#sciml.greet-Tuple{}","page":"API Reference","title":"sciml.greet","text":"Here is the documentation to my functions and methods.\n\n\n\n\n\n","category":"method"},{"location":"#Notes-on-learning-Artificial-Intelligence","page":"Introduction","title":"Notes on learning Artificial Intelligence","text":"","category":"section"},{"location":"#Linear-regressions","page":"Introduction","title":"Linear regressions","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"This is an example for the linear regression using the sciml package.","category":"page"},{"location":"#Happy-holidays","page":"Introduction","title":"Happy holidays","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"Vegerans day. Halloween.","category":"page"},{"location":"#My-experience","page":"Introduction","title":"My experience","text":"","category":"section"},{"location":"#職務経歴書","page":"Introduction","title":"職務経歴書","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"職務要約","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"現職でインフラ整備とクラウド開発、管理を中心に仕事しております。在学の研究者にAIと器械学習に関する研究もサポートしております。前職で約3年間金融業界でシステム開発、運用に従事し、計画、設計、にもとづいたテスト、保守、運用を幅広く担当しました。2020年から上流工程に携わり、ユーザへのヒアリング、要件定義なども担当していました。メンバーと協力や従業員との調整により、システムの品質を維持しながら期日通り完成できて、仕事の効率を上げるため貢献しました。 その前、営業部で経験しました。月度トップ１の実績を何度取得しました。顧客のニーズに合わせるコンサルティング力及びコミュニケーションを身につけました。","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"職務経歴","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"2024年1月〜現在　Durham University（イギリス） 【部署】Computing and Information Services　（システム部）","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"【仕事内容】 •\tインフラの整備と管理 1.\tサーバーとネットワークの機能と権限管理、 2.\tサーバーとネットワーク状況の監視、 3.\tセキュリティ対策。 •\tAzure の開発、運用と管理 1.\tシステムの更新企画、要件設計、テスト 2.\tユーザー要望をヒヤリングし、ニーズを確認、 3.\tセキュリティ管理、 4.\tクラウドの監視、保守、運用、 5.\t委託会社に設計要求を提出、資料作成、業務サポート 6.\tデータの管理、抽出。 •\tAI +機械学習に関する研究のサポート 1.\tデータの収集、分析 2.\tインフラの構築 •\t情報機器、システム更新企画、プロジェクト管理。 •\t問い合わせ、トラブルの対応（システム、設備）。","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"2018年4月〜2023年12月　イオン保険サービス株式会社","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"1)2020年10月〜2023年12月  【部署】システム部（2021年2月チーム責任者に昇格） 【仕事内容】 •\tDynamic365の開発、運用一連業務のマネジメント。 1.\tユーザーにヘアリングして、ニーズや機能要件を明確する。 2.\t委託会社に設計要求を提出、資料作成。 3.\tシステム開発段階のやりとり、チームワーク協力、会議資料準備など。 4.\t導入前システムのテストと使用、修正意見を提出。 5.\t導入後の運用、点検、保守。 6.\t導入後、データ抽出、更新などの管理。 7.\tシステム導入、更新、修正についてのコンサルティング •\tAzure の開発、運用。 1.\tユーザーにヘアリングして、ニーズや機能要件を明確する。 2.\t委託会社に設計要求を提出、資料作成。 3.\tシステム開発段階のやりとり、チームワーク協力、会議資料準備など。 4.\t導入前システムのテストと使用、修正意見を提出。 5.\t導入後の運用、点検、保守、権限とセキュリティ管理。 6.\tコールセンター機能支援、管理 7.\tBIツールを利用してcsvデータやエクセルデータなど管理。 8.\t仮想デスクトップの管理 •\tインフラの整備と管理 1.\tサーバーとネットワークの機能と権限管理、 2.\tサーバーとネットワーク状況の監視、 3.\tセキュリティ対策。 •\t問い合わせ、トラブルの対応（システム、設備）。 •\t設備の管理、保守、設定など全般的な業務。 •\tJAVAを利用して会社ホームページの更新、編集及びメンテナンス。","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"2)2019年6月〜2020年9月 【部署】幕張新都心店（当社旗艦店）　オートバンド営業チームリーダー 【仕事内容】 •\t新規開発及び既存維持をメインして、オートバンド営業のチームリーダーになって、良好関係を構築するに工夫した。マーケット戦略作成、イベント主催、企業訪問など任せられた。 •\tカウンター業務。来店顧客に保険案内、フォローなど 【実績】 •\t半年連続月度売上トップ３、達成感平均200％ •\t集客イベントで新規契約件数は年間全国トップ１ •\t当店職域営業活動で、イオングループ内トップリーダーの保険契約を100件以上取得、企業間良好関係構築に大貢献したため、特別ボーナス取得 【自分の工夫】 •\tリーダーシップ。チームとしての効率的な仕事方法、メンバー間の仲良し増進など努力しました。 •\tコンサルティング。顧客のライフスタイルやニーズに合わせる提案などスキルアップを常に意識しております。","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"3)2018年4月〜2019年5月 【部署】本社営業部　 【仕事内容】 •\t新規開発及び既存維持を含め、オートバンド営業をメインに任せられており、イベント主催、企業訪問、電話及び当面案内など経験した。 •\t法人及び個人営業とも力を注ぎ込め、両方担当されておりました。 【実績】 •\t月度売上トップ１、達成率150％を取得するのは複数回 •\t単価保険料売上トップ１にしたため、特別ボーナス取得 【自分の工夫】 •\t営業力。営業技術や案内力だけではなく、より良好関係構築も心込め、自分のバリューアップは注目しました。 •\t勉強力。まず、先輩社員を学び、社会人として知識及び仕事方を自分流にしました。そのほか、保険や金融知識を学び、専門資格を同期より早く取得しました。","category":"page"}]
